        <li className="concept">
          <img src={props.conceptsList[1].image} alt="stacked disks" />
          <h2>{props.conceptsList[1].title}</h2>
          <p>{props.conceptsList[1].description}</p>
        </li>
        <li className="concept">
          <img src={props.conceptsList[2].image} alt="flaring megaphone" />
          <h2>{props.conceptsList[2].title}</h2>
          <p>{props.conceptsList[2].description}</p>
        </li> */}
      </ul>
    </div>
  );
}
export default Concepts;
